def getVectorText(inputStr):
   locInc = 0
   outputVects = []
   
   for ch in inputStr:
      
      if ch == ' ':
         locInc += 1
         continue
      
      ch = ord(ch) - 33
      
      for pth in asciiPaths[ch]:
         for i in range(1, int(len(pth)/3)):
            outputVects.append(pth[(i-1)*3+0]+locInc)
            outputVects.append(pth[(i-1)*3+1])
            outputVects.append(pth[(i-1)*3+2])
            
            outputVects.append(pth[i*3+0]+locInc)
            outputVects.append(pth[i*3+1])
            outputVects.append(pth[i*3+2])
         
      locInc += 1
   
   return outputVects
